import React from "react";
import './intro.css';
import me from '../assets/me.png';
import { Link } from "react-router-dom";

function Intro(){
    return(
        <section id="Intro">
            <div className="introcontent">
               <span className="hello">Hello,</span>
               <span>I'm <span className="introName">Akshay Nena</span><br />Web Designer</span>
               <p className="introPara">I am a skilled full stack Web Designer with experience in creating visualy and user-friendly in React Framework </p>
               <Link><div className="btn"><img src="" alt="" />Hire Me</div></Link>
            </div>
            <img src={me} alt="Portfolio" className="me" />
        </section>
    )
}
export default Intro;
